INSERT INTO `news` VALUES ('1', '2022-01-20 09:04:51', '全国|昨日新增确诊病例66例，其中本土确诊病例43例', '1月19日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例66例。其中境外输入病例23例（上海14例，浙江3例，广东3例，云南2例，北京1例），含3例由无症状感染者转为确诊病例（均在浙江）；本土病例43例（河南24例，其中安阳市19例、许昌市4例、郑州市1例；天津14例，均在津南区；北京3例，其中丰台区2例、朝阳区1例；广东2例，均在珠海市），含7例由无症状感染者转为确诊病', '央视新闻app');
INSERT INTO `news` VALUES ('2', '2022-01-20 08:19:00', '河南|新增本土确诊病例24例', '记者从河南省卫健委了解到，1月19日0—24时，河南全省新增本土确诊病例24例（郑州市1例，安阳市19例，许昌市4例）；无新增无症状感染者和疑似病例；13例本土确诊病例治愈出院。（总台记者田萌王一丹）', '央视新闻app');
INSERT INTO `news` VALUES ('3', '2022-01-20 08:02:19', '北京|昨日新增本土确诊2例', '\n1月19日0时至24时，新增2例本土确诊病例（为昨日通报的核酸检测阳性者）和1例无症状感染者转确诊病例（为1月18日通报的核酸检测阳性者），无新增疑似病例和无症状感染者；新增1例境外输入确诊病例和2例无症状感染者，无新增疑似病例。本土新冠肺炎病例确诊病例1：现住丰台区万柳园社区，冷库搬运工，每周例行做核酸检测一次。自述于1月16日出现咳嗽症状，自行服用购买的感冒药，未就医。1月19日报告核酸检测结果为阳性，市疾控中心检测出德尔塔变异株特异性突变位点，综合流行病史、临床表现、实验室检测和影像学检查等结果，当日诊断为确诊病例，临床分型为轻型，已转至定点医院隔离治疗。确诊病例2：与确诊病例1共同居住，冷库搬运工，每周例行做核酸检测一次。自述于1月6日出现咳嗽等症状，自行服用购买的感冒药，未就医。1月19日报告核酸检测结果为阳性，市疾控中心检测出德尔塔变异株特异性突变位点，综合流行病史、临床表现、实验室检测和影像学检查等结果，当日诊断为确诊病例，临床分型为轻型，已转至定点医院隔离治疗。确诊病例3：现住朝阳区平房乡石各庄村，2021年11月来京务工，为1月18日诊断的无症状感染者。 1月19日患者出现头痛、咽痛等症状，综合流行病史、临床表现、实验室检测和影像学检查等结果，当日诊断为确诊病例，临床分型为轻型，继续在定点医院隔离治疗。境外输入确诊病例确诊病例：中国籍，1月16日从德国到达北京首都机场，海关经健康筛查并进行核酸检测后，经闭环管理送至集中隔离酒店，1月18日报告核酸检测结果为阳性，当日转至定点医院，综合流行病史、临床表现、实验室检测和影像学检查等结果，1月19日诊断为确诊病例，临床分型为轻型。已对上述病例开展流行病学调查，按要求落实管控措施。全市16区无报告病例天数情况地区\n无报告病例天数\n平谷区\n无报告病例\n延庆区\n727\n密云区\n708\n石景山区\n584\n门头沟区\n583\n东城区\n582\n西城区\n576\n怀柔区\n384\n顺义区\n365\n大兴区\n355\n房山区\n162\n昌平区\n73\n通州区\n31\n海淀区\n1\n朝阳区\n0\n丰台区\n0\n2020年2月29日发生境外输入疫情以来境外输入确诊病例来源国（地区）情况来源国（地区）\n确诊病例数\n英国\n76\n西班牙\n47\n意大利\n26\n美国\n21\n瑞典\n20\n塞尔维亚\n19\n巴基斯坦\n14\n奥地利\n13\n希腊\n12\n阿联酋\n10\n法国\n8\n加拿大\n8\n土库曼斯坦\n7\n德国\n6\n菲律宾\n5\n泰国\n5\n匈牙利\n4\n伊朗\n4\n俄罗斯\n4\n瑞士\n3\n津巴布韦\n3\n韩国\n3\n土耳其\n3\n印度尼西亚\n2\n巴布亚新几内亚\n2\n摩尔多瓦\n2\n丹麦\n2\n波兰\n2\n埃塞俄比亚\n2\n卢森堡\n1\n挪威\n1\n比利时\n1\n巴西\n1\n荷兰\n1\n墨西哥\n1\n约旦\n1\n赤道几内亚\n1\n日本\n1\n乌兹别克斯坦\n1\n中国香港\n4\n中国台湾\n1\n合计\n348\n当前，疫情防控形势严峻复杂，要立足早发现，快速处置，精准防控，有效控制疫情传播，冷链、电商、物流、服务等行业要做好重点环节的检测消毒，从业人员要落实好个人防护、健康监测、核酸检测等防控措施。提醒广大市民朋友要切实履行个人防控责任，与本市公布的病例活动轨迹有交集的人员尽快主动报告，并积极进行核酸检测，检测时要正确佩戴口罩，自觉保持一米线距离，不聚集。注意手部卫生，不要用手触碰采样台、医务人员防护服等，采样后请立即离开。核酸检测结果未出之前，自觉做到不聚集、不离京，如身体不适，及时就近就医。再次提醒市民朋友要进一步增强个人防护意识，提倡简约生活方式，减少人员流动，减少不必要的聚餐聚会，尤其不要带儿童、老人及体弱者到人员聚集的公共场所，做好自己健康的第一责任人。\n\n', '北京卫健委');
INSERT INTO `news` VALUES ('4', '2022-01-20 09:01:33', '天津|昨日新增本土确诊14例', '2022年1月19日0—24时，天津市新增14例本土新冠肺炎确诊病例。无新增境外输入性新冠肺炎确诊病例。无新增本土无症状感染者，无新增境外输入无症状感染者。治愈出院14人（境外输入病例）。\n自2022年1月8日至1月19日，天津市累计报告本土新冠肺炎确诊病例340例，在院340例。累计报告无症状感染者22例，其中尚在医学观察6例，转为确诊病例16例。\n自2020年1月至2022年1月19日，天津市', '央视新闻app');
INSERT INTO `news` VALUES ('5', '2022-01-20 09:12:59', '浙江|昨日新增境外输入确诊3例', '据浙江省卫健委消息，1月19日0—24时，浙江省新增确诊病例3例（均为之前境外输入的无症状感染者转确诊），新增无症状感染者2例（均为伊拉克输入），已排查密切接触者均已实施集中隔离。截至19日24时，累计报告确诊病例2101例（境外输入病例348例）。\n（总台记者吴文轩于晨）', '央视新闻app');
INSERT INTO `news` VALUES ('6', '2022-01-21 09:34:32', '全国|昨日新增确诊病例73例，其中本土确诊病例23例', '1月20日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例73例。其中境外输入病例50例（上海28例，广东10例，山东6例，北京2例，福建2例，河南1例，广西1例），含2例由无症状感染者转为确诊病例（河南1例，广东1例）；本土病例23例（天津8例，均在津南区；北京5例，其中房山区3例、丰台区2例；广东4例，均在珠海市；河南3例，均在安阳市；陕西3例，均在西安市）。无新增死亡', '央视新闻app');
INSERT INTO `news` VALUES ('7', '2022-01-21 07:51:59', '北京|昨日新增5例本土确诊病例', '1月20日0时至24时，北京新增5例本土确诊病例（昨日已通报），无新增疑似病例和无症状感染者；新增2例境外输入确诊病例和12例无症状感染者，无新增疑似病例。治愈出院1例。\n本土确诊病例\n确诊病例1：现住房山区长阳镇北广阳城大街8号单位宿舍，每周例行做一次核酸检测。自述于1月17日出现咳嗽症状，自行服用自备药，未就医。1月19日报告核酸检测结果为阳性。综合流行病史、临床表现、实验室检测和影像学检查等', '央视新闻app');
INSERT INTO `news` VALUES ('8', '2022-01-21 08:00:00', '河南|昨日新增3例本土确诊病例', '1月20日0—24时，河南全省新增本土确诊病例3例（安阳市3例）；新增境外输入无症状感染者1例；新增境外输入无症状感染者转确诊病例1例；无新增疑似病例；21例确诊病例治愈出院（本土19例，境外输入2例）。（总台记者田萌王一丹）', '央视新闻app');
INSERT INTO `news` VALUES ('9', '2022-01-21 08:51:31', '天津|昨日新增8例本土确诊病例', '2022年1月20日0－24时，天津市新增8例本土新冠肺炎确诊病例。无新增境外输入性新冠肺炎确诊病例。无新增本土无症状感染者，无新增境外输入无症状感染者。治愈出院5人（境外输入病例）。\n自2022年1月8日至1月20日，天津市累计报告本土新冠肺炎确诊病例348例，在院348例。累计报告无症状感染者22例，其中尚在医学观察6例，转为确诊病例16例。\n自2020年1月至2022年1月20日，天津市累计', '央视新闻app');
INSERT INTO `news` VALUES ('10', '2022-01-21 08:47:50', '广东|昨日新增4例本土确诊病例', '1月20日0-24时，广东全省新增本土确诊病例4例，均为珠海报告。\n广东全省新增境外输入确诊病例10例（其中1例为无症状感染者转确诊），广州报告5例，2例来自土耳其，其余3例分别来自美国、韩国和孟加拉国；深圳报告3例，均来自韩国；东莞报告2例，分别来自中国香港和美国。新增境外输入无症状感染者9例，广州报告4例，2例来自土耳其，其余2例分别来自孟加拉国和哥斯达黎加；佛山报告3例，均来自沙特阿拉伯；东', '央视新闻app');
INSERT INTO `news` VALUES ('11', '2022-01-22 08:55:00', '全国|昨日新增63例确诊病例，其中23例本土病例', '1月21日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例63例。其中境外输入病例40例（上海22例，福建4例，广东4例，四川3例，浙江2例，广西2例，北京1例，山东1例，云南1例），含8例由无症状感染者转为确诊病例（四川3例，浙江2例，福建2例，广东1例）；本土病例23例（北京10例，其中丰台区6例、海淀区2例、大兴区1例、经济开发区1例；天津6例，均在津南区；河南4例，', '央视新闻app');
INSERT INTO `news` VALUES ('12', '2022-01-22 07:42:37', '上海|昨日新增22例境外确诊病例', '2022年1月21日0—24时，上海通过口岸联防联控机制，报告22例新增境外输入新冠肺炎确诊病例。新增治愈出院29例，其中来自美国10例，来自加拿大4例，来自英国3例，来自法国3例，来自尼日利亚2例，来自玻利维亚1例，来自巴西1例，来自乌干达1例，来自荷兰1例，来自新加坡1例，来自刚果（金）1例，来自哥伦比亚1例。\n病例1为中国籍，在俄罗斯工作，自俄罗斯出发，于2022年1月14日抵达上海浦东国际', '央视新闻app');
INSERT INTO `news` VALUES ('13', '2022-01-22 08:44:39', '广东|昨日新增7例确诊病例，其中3例本土病例', '1月21日0—24时，广东省新增本土确诊病例3例，均为珠海报告。\n广东省新增境外输入确诊病例4例（其中1例为无症状感染者转确诊），均为广州报告，2例来自澳大利亚，其余2例分别来自美国和加拿大。新增境外输入无症状感染者3例，广州报告1例，来自孟加拉国；佛山报告2例，均来自沙特阿拉伯。新增出院15例，目前在院230例。\n截至1月21日24时，广东省累计报告新冠肺炎阳性感染者7087例（境外输入5057', '央视新闻app');
INSERT INTO `news` VALUES ('14', '2022-01-22 08:56:44', '天津|昨日新增6例本土确诊病例', '2022年1月21日0—24时，天津市新增6例本土新冠肺炎确诊病例。无新增境外输入新冠肺炎确诊病例。无新增本土无症状感染者，新增2例境外输入无症状感染者。治愈出院20人（其中本土病例3人，境外输入病例17人）。\n自2022年1月8日至1月21日，天津市累计报告本土新冠肺炎确诊病例354例，在院351例。累计报告无症状感染者22例，其中尚在医学观察6例，转为确诊病例16例。\n自2020年1月至202', '央视新闻app');
INSERT INTO `news` VALUES ('15', '2022-01-22 09:31:38', '浙江|昨日新增2例境外确诊病例', '根据浙江省卫健委消息，1月21日0—24时，浙江新增确诊病例2例（均为之前境外输入的无症状感染者转确诊），新增无症状感染者4例（其中日本输入2例，刚果输入1例，墨西哥输入1例），已排查密切接触者均已实施集中隔离。截至21日24时，累计报告确诊病例2103例（境外输入病例350例）。\n（总台记者于晨吴文轩）', '央视新闻app');
INSERT INTO `news` VALUES ('41', '2022-01-23 08:52:00', '全国|昨日新增56例确诊病例，其中19例本土病例', '1月22日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例56例。其中境外输入病例37例（上海13例，浙江6例，广东5例，四川4例，云南4例，山东3例，福建1例，广西1例），含14例由无症状感染者转为确诊病例（浙江6例，四川4例，广东3例，广西1例）；本土病例19例（北京9例，其中丰台区6例、房山区2例、海淀区1例；天津5例，均在津南区；广东3例，均在珠海市；河南1例，在安', '央视新闻app');
INSERT INTO `news` VALUES ('42', '2022-01-23 08:07:40', '北京|昨日新增9例本土确诊病例', '\n1月22日0时至24时，新增9例本土确诊病例（含1例1月21日诊断的无症状感染者转确诊病例，确诊病例1至6昨日均已通报）、4例本土无症状感染者（无症状感染者1昨日已通报），无新增疑似病例；新增5例境外输入无症状感染者，无新增境外输入确诊病例和疑似病例。治愈出院2例。本土新冠肺炎病例确诊病例1： 现住丰台区南苑街道南庭新苑小区，为确诊病例的密切接触者。1月20日转至集中隔离点，1月21日出现发热症状，核酸检测结果为阳性，已转至定点医院，综合流行病史、临床表现、实验室检测和影像学检查等结果，1月22日诊断为确诊病例，临床分型为轻型。确诊病例2：现住丰台区玉泉营街道玉泉营212号院，工作地点为西南郊冷库。自述曾多次在华兴饭庄用餐。作为确诊病例的密切接触者进行核酸检测，1月21日报告结果为阳性，已转至定点医院，综合流行病史、临床表现、实验室检测和影像学检查等结果，1月22日诊断为确诊病例，临床分型为普通型。确诊病例3：现住丰台区新村街道怡海花园恒丰园小区，工作单位为丰台区怡海花园恒丰园7号楼一层好多家拉面包子饭店（怡海花园店）。自述于1月13日曾前往玉泉营果品公司宿舍，曾多次在华兴饭庄用餐。1月18日出现咳痰等症状。1月21日作为风险管控人群进行核酸检测，结果为阳性，已转至定点医院，综合流行病史、临床表现、实验室检测和影像学检查等结果，1月22日诊断为确诊病例，临床分型为轻型。确诊病例4：现住房山区长阳镇北广阳城大街8号，工作地点同现住址。1月19日作为确诊病例的密切接触者转至集中隔离点，期间两次核酸检测结果均为阴性，1月21日报告结果为阳性，已转至定点医院，综合流行病史、临床表现、实验室检测和影像学检查等结果，1月22日诊断为确诊病例，临床分型为轻型。确诊病例5：现住房山区长阳镇北广阳城大街8号，工作地点同现住址。1月19日作为确诊病例的密切接触者转至集中隔离点，期间两次核酸检测结果均为阴性，1月21日报告结果为阳性，已转至定点医院，综合流行病史、临床表现、实验室检测和影像学检查等结果，1月22日诊断为确诊病例，临床分型为轻型。确诊病例6：现住丰台区玉泉营街道玉泉营212号院，工作地点为西南郊冷库。1月18日出现咳嗽等症状，自行服药，未就诊。作为确诊病例的密切接触者进行核酸检测，1月21日报告结果为阳性，已转至定点医院，综合流行病史、临床表现、实验室检测和影像学检查等结果，1月22日诊断为确诊病例，临床分型为轻型。确诊病例7：现住海淀区永丰路百旺茉莉园一期，为确诊病例的密切接触者。1月18日转至集中隔离点，1月22日报告核酸检测结果为阳性，已转至定点医院，综合流行病史、临床表现、实验室检测和影像学检查等结果，1月22日诊断为确诊病例，临床分型为轻型。确诊病例8：现住丰台区新村街道怡海花园恒丰园小区，工作单位为丰台区怡海花园恒丰园7号楼一层好多家拉面包子饭店（怡海花园店）。1月13日曾在华兴饭庄就餐。1月22日报告核酸检测结果为阳性，已转至定点医院，综合流行病史、临床表现、实验室检测和影像学检查等结果，1月22日诊断为确诊病例，临床分型为轻型。确诊病例9：现住丰台区郑王坟141号院，为1月21日诊断为无症状感染者。当日出现发热症状，综合流行病史、临床表现、实验室检测和影像学检查等结果，1月22日诊断为确诊病例，临床分型为轻型。继续在定点医院隔离治疗。无症状感染者1：现住丰台区南苑街道南庭新苑小区。1月20日作为确诊病例的密切接触者转至集中隔离点，1月21日核酸检测结果为阳性，已转至定点医院，综合流行病史、临床表现、实验室检测和影像学检查等结果，1月22日诊断为无症状感染者。无症状感染者2至4：均现住丰台区新村街道怡海花园恒丰园小区，工作单位均为丰台区怡海花园恒丰园7号楼一层好多家拉面包子饭店（怡海花园店）。1月13日曾在华兴饭庄就餐。1月22日报告核酸检测结果为阳性，已转至定点医院，综合流行病史、临床表现、实验室检测和影像学检查等结果，1月22日诊断为无症状感染者。已对上述病例开展流行病学调查，按要求落实管控措施。全市16区无报告病例天数情况地区\n无报告病例天数\n平谷区\n无报告病例\n延庆区\n730\n密云区\n711\n石景山区\n587\n门头沟区\n586\n东城区\n585\n西城区\n579\n怀柔区\n387\n顺义区\n368\n昌平区\n76\n通州区\n34\n朝阳区\n3\n大兴区\n1\n海淀区\n0\n丰台区\n0\n房山区\n0\n2020年2月29日发生境外输入疫情以来境外输入确诊病例来源国（地区）情况来源国（地区）\n确诊病例数\n英国\n76\n西班牙\n47\n意大利\n26\n美国\n21\n瑞典\n20\n塞尔维亚\n19\n巴基斯坦\n14\n奥地利\n13\n希腊\n12\n阿联酋\n10\n加拿大\n9\n法国\n8\n土库曼斯坦\n7\n德国\n7\n菲律宾\n5\n泰国\n5\n匈牙利\n4\n伊朗\n4\n俄罗斯\n4\n瑞士\n3\n津巴布韦\n3\n韩国\n3\n土耳其\n3\n印度尼西亚\n2\n巴布亚新几内亚\n2\n摩尔多瓦\n2\n丹麦\n2\n波兰\n2\n埃塞俄比亚\n2\n卢森堡\n1\n挪威\n1\n比利时\n1\n巴西\n1\n荷兰\n1\n墨西哥\n1\n约旦\n1\n赤道几内亚\n1\n日本\n1\n乌兹别克斯坦\n1\n中国香港\n5\n中国台湾\n1\n合计\n351\n当前，全市疫情呈现多点散发态势，疫情防控形势严峻复杂，要坚持从严从快从紧，快速开展病例调查、风险人员及物品排查，人物同溯、同防、同查、同管。严格落实四方责任，以最快速度、最有效措施，最大限度阻止疫情蔓延。请1月1日至1月20日8时到访过房山区长阳镇北广阳城大街8号、丰台区西南郊冷库、丰台区玉泉营212号院、丰台区华兴饭庄(玉泉营店)、丰台区郑王坟141号院7号楼、丰台区玉泉营果品公司、丰台区晶冷冷库、丰台区南庭新苑北区316号院7号楼、丰台区万柳园小区、丰台区怡海花园恒丰园1号、丰台区亿朋苑小区、丰台区宜兰园、朝阳区平房乡石各庄村、丰台区北水嘉伦水产品市场、丰台区好多家拉面包子(怡海花园店)、丰台区北京禽蛋公司、房山区北京三江宏利牧业有限公司、房山区红日超市(碧波园店)人员、与病例轨迹有交集人员，或接到健康宝弹窗提示的人员，立即主动向社区报告，配合落实居家隔离、健康监测、核酸检测等防控措施。冷链、食品、物流、保洁等从业人员及同住人员要积极按照所在单位统一部署进行核酸检测，检测时要正确佩戴口罩，自觉保持一米线距离，不聚集。核酸检测结果未出之前，自觉做到不聚集、不离京。天气寒冷，广大市民朋友要做好个人防护，加强防寒保暖，理解、配合和支持医务人员、流调人员、检测人员、社区工作者、公安干警、志愿者等一线疫情防控人员的工作，履行好疫情防控个人责任，共同筑牢首都安全屏障。\n\n', '北京卫健委');
INSERT INTO `news` VALUES ('43', '2022-01-23 07:48:31', '上海|昨日新增13例境外确诊病例', '2022年1月22日0—24时，通过口岸联防联控机制，上海报告13例新增境外输入新冠肺炎确诊病例。新增治愈出院38例，其中来自美国13例，来自加拿大7例，来自英国6例，来自捷克1例，来自斯里兰卡1例，来自埃塞俄比亚1例，来自西班牙1例，来自乌克兰1例，来自丹麦1例，来自尼日利亚1例，来自加纳1例，来自德国1例，来自科特迪瓦1例，来自格鲁吉亚1例，来自俄罗斯1例。\n病例1为中国籍，在美国留学，自美国', '央视新闻app');
INSERT INTO `news` VALUES ('44', '2022-01-23 08:39:00', '河南|昨日新增1例本土确诊病例', '总台央视记者从河南省卫健委了解到，1月22日0—24时，河南全省新增本土确诊病例1例（安阳市1例）；新增境外输入无症状感染者1例；无新增疑似病例；30例本土确诊病例治愈出院。（总台记者田萌王一丹）', '央视新闻app');
INSERT INTO `news` VALUES ('45', '2022-01-23 17:22:36', '北京|昨日新增本土确诊9例', '\n1月22日16时至1月23日16时，本市新增9例本土新冠肺炎病例，其中，确诊病例5例，无症状感染者4例。结合流行病学调查及病毒全基因测序结果，本轮疫情目前为两个较为明确的传播链条，分别为奥密克戎变异株关联疫情和德尔塔变异株关联疫情。1月15日至1月22日16时，奥密克戎变异株关联疫情累计报告本土新冠肺炎病例5例，均为确诊病例，均为轻型；1月18日至1月22日16时，德尔塔变异株关联疫情累计报告本土新冠肺炎病例29例，其中，确诊病例23例（轻型16例、普通型7例）、无症状感染者6例。为便于公众了解本市疫情情况，即日起在前期已公布病例的基础上分别从两条传播链条对病例按连续编号的形式进行公布。一、奥密克戎变异株关联疫情病例6：现住海淀区马连洼街道永丰路百旺茉莉园一期，1月18日作为确诊病例的密切接触者转至集中隔离点。1月22日核酸检测结果为阳性，已转至定点医院，综合流行病史、临床表现、实验室检测和影像学检查等结果，当日诊断为确诊病例，临床分型为轻型。二、德尔塔变异株关联疫情病例30：现住丰台区新村街道怡海花园恒丰园小区，工作地点为丰台区怡海花园恒丰园7号楼一层好多家拉面包子饭店（怡海花园店）。作为确诊病例的密切接触者进行核酸检测，1月22日报告结果为阳性，已转至定点医院，综合流行病史、临床表现、实验室检测和影像学检查等结果，当日诊断为确诊病例，临床分型为轻型。病例31：现住丰台区新村街道怡海花园恒丰园小区，工作地点为丰台区怡海花园恒丰园7号楼一层好多家拉面包子饭店（怡海花园店）。作为确诊病例的密切接触者进行核酸检测，1月22日报告结果为阳性，已转至定点医院，综合流行病史、临床表现、实验室检测和影像学检查等结果，当日诊断为无症状感染者。病例32：现住丰台区新村街道怡海花园恒丰园小区，工作地点为丰台区怡海花园恒丰园7号楼一层好多家拉面包子饭店（怡海花园店）。作为确诊病例的密切接触者进行核酸检测，1月22日报告结果为阳性，已转至定点医院，综合流行病史、临床表现、实验室检测和影像学检查等结果，当日诊断为无症状感染者。病例33：现住丰台区新村街道怡海花园恒丰园小区，工作地点为丰台区怡海花园恒丰园7号楼一层好多家拉面包子饭店（怡海花园店）。作为确诊病例的密切接触者进行核酸检测，1月22日报告结果为阳性，已转至定点医院，综合流行病史、临床表现、实验室检测和影像学检查等结果，当日诊断为无症状感染者。病例34：现住丰台区玉泉营街道玉泉营212号院，工作地点为西南郊冷库。自述曾到华兴饭庄用餐，1月20日出现咽干症状。作为确诊病例的密切接触者进行核酸检测，1月22日报告结果为阳性，已转至定点医院，综合流行病史、临床表现、实验室检测和影像学检查等结果，1月23日诊断为确诊病例，临床分型为轻型。病例35：现住经济开发区博兴街道亦庄移动硅谷亚朵酒店。1月17日抵京，1月22日作为确诊病例的密切接触者转至集中隔离点，当日核酸检测结果为阳性，已转至定点医院，综合流行病史、临床表现、实验室检测和影像学检查等结果，1月23日诊断为无症状感染者。病例36：现住房山区长阳镇北广阳城大街8号，工作地点同现住址。1月19日作为确诊病例的密切接触者转至集中隔离点，1月23日核酸检测结果为阳性，已转至定点医院，综合流行病史、临床表现、实验室检测和影像学检查等结果，当日诊断为确诊病例，临床分型为轻型。病例37：现住大兴区安定镇后辛房村。作为确诊病例的密切接触者进行核酸检测，1月23日报告结果为阳性，已转至定点医院，综合流行病史、临床表现、实验室检测和影像学检查等结果，当日诊断为确诊病例，临床分型为轻型。目前已开展流行病学调查和密切接触者追踪，对所涉及风险点位进行排查，对各类风险人员进行分类管控。1月15日以来，本市累计报告本土新冠肺炎病例43例，其中，奥密克戎变异株关联疫情累计报告病例6例，均为确诊病例，均为轻型；德尔塔变异株关联疫情累计报告病例37例，确诊病例27例、无症状感染者10例。当前，奥密克戎变异株关联疫情总体平稳，新增病例均来自管控人员，社区传播风险有限。德尔塔变异株关联疫情目前处于发展阶段，传播链条基本清晰，已发现病例均直接或间接与冷链物品或相关从业人员有关。全市疫情防控形势严峻复杂，要坚持从严从快从紧，快速开展病例调查、风险人员及物品排查，人物同溯、同防、同查、同管，市场、超市、公共卫生间等公共场所要加强清洁、通风与消毒管理。正值冬季，天气寒冷，要注意添加衣物，防寒保暖。再次提醒广大市民朋友，请与病例活动轨迹有交集的人员，或接到健康宝弹窗提示的人员，立即主动向社区报告，配合落实防控措施。进行核酸检测时服从安排，有序排队，保持安全社交距离，做好个人防护，履行好疫情防控个人责任，共同筑牢首都安全屏障。\n\n', '北京卫健委');
INSERT INTO `news` VALUES ('51', '2022-01-25 08:52:43', '全国|昨日新增确诊病例45例，其中本土确诊病例18例', '1月24日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例45例。其中境外输入病例27例（上海10例，广西5例，云南4例，北京3例，浙江3例，广东2例），含5例由无症状感染者转为确诊病例（浙江2例，广西2例，广东1例）；本土病例18例（新疆6例，均在伊犁哈萨克自治州；北京5例，其中丰台区4例、朝阳区1例；河南3例，均在安阳市；河北2例，均在雄安新区；天津1例，在津南区；上海', '央视新闻app');
INSERT INTO `news` VALUES ('52', '2022-01-25 08:19:18', '新疆|昨日新增6例本土确诊病例', '新疆维吾尔自治区卫生健康委最新通报，1月24日0时至24时，新疆维吾尔自治区（含新疆生产建设兵团）新增确诊病例6例，无症状感染者16例，为伊犁州霍尔果斯市报告。\n截至1月24日24时，新疆（含兵团）现有确诊病例6例，无症状感染者18例，均在伊犁州霍尔果斯市。', '央视新闻app');
INSERT INTO `news` VALUES ('53', '2022-01-25 07:53:35', '北京|昨日新增5例本土确诊病例', '1月24日0时至24时，北京新增5例本土确诊病例（昨日已通报）和1例无症状感染者（昨日已通报），无新增疑似病例；新增3例境外输入确诊病例和2例无症状感染者，无新增疑似病例。\n本土新冠肺炎病例\n确诊病例1：现住丰台区玉泉营街道马家楼村，工作地点为西南郊冷库。自述曾多次在华兴饭庄用餐。作为风险管控人员进行核酸检测，1月23日报告结果为阳性，已转至定点医院，综合流行病史、临床表现、实验室检测和影像学检查', '央视新闻app');
INSERT INTO `news` VALUES ('54', '2022-01-25 09:14:31', '河南|昨日新增3例本土确诊病例', '1月25日，记者从河南省安阳市新冠肺炎疫情防控第十五场新闻发布会上了解到，1月24日0至24时，安阳市新增报告确诊病例3例，为汤阴县报告，集中隔离筛查发现。\n1月8日以来，安阳全市累计报告确诊病例464例，其中汤阴县440例，文峰区19例（连续7日无新增），滑县2例（连续12日无新增），内黄县2例（连续11日无新增），安阳县1例（连续15日无新增）。\n（总台记者李凡段清臣刘晓雅）', '央视新闻app');
INSERT INTO `news` VALUES ('55', '2022-01-25 08:13:26', '河北|昨日新增2例本土确诊病例', '1月25日，河北省卫生健康委员会发布，2022年1月24日0—24时，河北省新增本土新型冠状病毒肺炎确诊病例2例（雄安新区，均为正在集中隔离的北京丰台区返乡人员），无新增本土无症状感染者。\n截至1月24日24时，河北省现有本土确诊病例5例；尚在医学观察本土无症状感染者0例。\n(总台记者王帅南王龙)', '央视新闻app');
INSERT INTO `news` VALUES ('56', '2022-01-27 08:57:00', '全国|昨日新增确诊病例63例，其中本土确诊病例25例', '1月26日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例63例。其中境外输入病例38例（上海20例，云南5例，浙江4例，广东3例，河南2例，北京1例，吉林1例，广西1例，四川1例），含6例由无症状感染者转为确诊病例（浙江4例，广东1例，云南1例）；本土病例25例（浙江6例，均在杭州市；北京5例，均在丰台区；黑龙江5例，均在牡丹江市；河北4例，均在廊坊市；天津1例，在河北区', '央视新闻app');
INSERT INTO `news` VALUES ('57', '2022-01-27 08:07:05', '黑龙江|昨日新增本土确诊病例5例', '2022年1月26日0—24时，黑龙江省新增本土确诊病例5例（绥芬河市5例），含1例由无症状感染者转为确诊病例；新增本土无症状感染者11例（绥芬河市9例、东宁市1例、肇东市1例）。新增阳性感染者均为集中隔离管控筛查发现。\n截至1月26日24时，全省现有本土确诊病例9例，现有本土无症状感染者19例。\n自1月26日起，绥芬河市鸿福小区、千园小区、良运公司、环保局家属楼、二中集资楼、兴建大厦调整为中风险', '央视新闻app');
INSERT INTO `news` VALUES ('58', '2022-01-27 08:11:09', '河北|昨日新增本土确诊病例4例', '1月27日，河北省卫生健康委员会发布，2022年1月26日0—24时，河北省新增本土新型冠状病毒肺炎确诊病例4例（廊坊市，为北京丰台区返乡人员及其密接），无新增本土无症状感染者。\n截至1月26日24时，河北省现有本土确诊病例10例；尚在医学观察本土无症状感染者0例。\n（总台记者：王帅南王龙）', '央视新闻app');
INSERT INTO `news` VALUES ('59', '2022-01-27 09:03:06', '天津|昨日新增本土确诊1例', '2022年1月26日0—24时，天津市新增1例本土新冠肺炎确诊病例。无新增境外输入性新冠肺炎确诊病例。无新增本土无症状感染者，无新增境外输入无症状感染者。治愈出院58人（其中本土病例56人，境外输入病例2人）。本土无症状感染者解除医学观察3人。\n自2022年1月8日至1月26日，天津市累计报告本土新冠肺炎确诊病例362例，治愈出院188人，在院174例。累计报告无症状感染者22例，解除医学观察5人', '央视新闻app');
INSERT INTO `news` VALUES ('60', '2022-01-27 09:15:06', '河南安阳市|昨日新增确诊病例1例', '1月27日，记者从河南省安阳市新冠肺炎疫情防控工作第十六场新闻发布会上了解到，1月26日0时至24时，安阳市新增报告确诊病例1例，为汤阴县集中隔离筛查发现。\n截至1月26日24时，本轮疫情累计报告确诊病例466例，其中汤阴县442例（连续6日新增报告病例数在3例以下，且均为集中隔离筛查发现，社会面无新增病例），文峰区19例（连续9日无新增），滑县2例（连续14日无新增），内黄县2例（连续13日无新', '央视新闻app');
INSERT INTO `news` VALUES ('61', '2022-01-27 08:57:00', '全国|昨日新增确诊病例63例，其中本土确诊病例25例', '1月26日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例63例。其中境外输入病例38例（上海20例，云南5例，浙江4例，广东3例，河南2例，北京1例，吉林1例，广西1例，四川1例），含6例由无症状感染者转为确诊病例（浙江4例，广东1例，云南1例）；本土病例25例（浙江6例，均在杭州市；北京5例，均在丰台区；黑龙江5例，均在牡丹江市；河北4例，均在廊坊市；天津1例，在河北区', '央视新闻app');
INSERT INTO `news` VALUES ('62', '2022-01-27 08:07:05', '黑龙江|昨日新增本土确诊病例5例', '2022年1月26日0—24时，黑龙江省新增本土确诊病例5例（绥芬河市5例），含1例由无症状感染者转为确诊病例；新增本土无症状感染者11例（绥芬河市9例、东宁市1例、肇东市1例）。新增阳性感染者均为集中隔离管控筛查发现。\n截至1月26日24时，全省现有本土确诊病例9例，现有本土无症状感染者19例。\n自1月26日起，绥芬河市鸿福小区、千园小区、良运公司、环保局家属楼、二中集资楼、兴建大厦调整为中风险', '央视新闻app');
INSERT INTO `news` VALUES ('63', '2022-01-27 08:11:09', '河北|昨日新增本土确诊病例4例', '1月27日，河北省卫生健康委员会发布，2022年1月26日0—24时，河北省新增本土新型冠状病毒肺炎确诊病例4例（廊坊市，为北京丰台区返乡人员及其密接），无新增本土无症状感染者。\n截至1月26日24时，河北省现有本土确诊病例10例；尚在医学观察本土无症状感染者0例。\n（总台记者：王帅南王龙）', '央视新闻app');
INSERT INTO `news` VALUES ('64', '2022-01-27 09:03:06', '天津|昨日新增本土确诊1例', '2022年1月26日0—24时，天津市新增1例本土新冠肺炎确诊病例。无新增境外输入性新冠肺炎确诊病例。无新增本土无症状感染者，无新增境外输入无症状感染者。治愈出院58人（其中本土病例56人，境外输入病例2人）。本土无症状感染者解除医学观察3人。\n自2022年1月8日至1月26日，天津市累计报告本土新冠肺炎确诊病例362例，治愈出院188人，在院174例。累计报告无症状感染者22例，解除医学观察5人', '央视新闻app');
INSERT INTO `news` VALUES ('65', '2022-01-27 09:15:06', '河南安阳市|昨日新增确诊病例1例', '1月27日，记者从河南省安阳市新冠肺炎疫情防控工作第十六场新闻发布会上了解到，1月26日0时至24时，安阳市新增报告确诊病例1例，为汤阴县集中隔离筛查发现。\n截至1月26日24时，本轮疫情累计报告确诊病例466例，其中汤阴县442例（连续6日新增报告病例数在3例以下，且均为集中隔离筛查发现，社会面无新增病例），文峰区19例（连续9日无新增），滑县2例（连续14日无新增），内黄县2例（连续13日无新', '央视新闻app');
INSERT INTO `news` VALUES ('66', '2022-01-27 08:57:00', '全国|昨日新增确诊病例63例，其中本土确诊病例25例', '1月26日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例63例。其中境外输入病例38例（上海20例，云南5例，浙江4例，广东3例，河南2例，北京1例，吉林1例，广西1例，四川1例），含6例由无症状感染者转为确诊病例（浙江4例，广东1例，云南1例）；本土病例25例（浙江6例，均在杭州市；北京5例，均在丰台区；黑龙江5例，均在牡丹江市；河北4例，均在廊坊市；天津1例，在河北区', '央视新闻app');
INSERT INTO `news` VALUES ('67', '2022-01-27 08:07:05', '黑龙江|昨日新增本土确诊病例5例', '2022年1月26日0—24时，黑龙江省新增本土确诊病例5例（绥芬河市5例），含1例由无症状感染者转为确诊病例；新增本土无症状感染者11例（绥芬河市9例、东宁市1例、肇东市1例）。新增阳性感染者均为集中隔离管控筛查发现。\n截至1月26日24时，全省现有本土确诊病例9例，现有本土无症状感染者19例。\n自1月26日起，绥芬河市鸿福小区、千园小区、良运公司、环保局家属楼、二中集资楼、兴建大厦调整为中风险', '央视新闻app');
INSERT INTO `news` VALUES ('68', '2022-01-27 08:11:09', '河北|昨日新增本土确诊病例4例', '1月27日，河北省卫生健康委员会发布，2022年1月26日0—24时，河北省新增本土新型冠状病毒肺炎确诊病例4例（廊坊市，为北京丰台区返乡人员及其密接），无新增本土无症状感染者。\n截至1月26日24时，河北省现有本土确诊病例10例；尚在医学观察本土无症状感染者0例。\n（总台记者：王帅南王龙）', '央视新闻app');
