INSERT INTO `news` VALUES ('81', '2022-01-28 08:58:20', '全国|昨日新增64例确诊病例，其中39例本土病例', '1月27日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例64例。其中境外输入病例25例（上海7例，广东7例，云南5例，北京2例，山东2例，浙江1例，广西1例），含1例由无症状感染者转为确诊病例（在广东）；本土病例39例（浙江16例，均在杭州市；黑龙江9例，均在牡丹江市；北京8例，其中丰台区7例、大兴区1例；天津4例，均在河北区；贵州1例，在安顺市；兵团1例，在建设兵团第四', '央视新闻app');
INSERT INTO `news` VALUES ('82', '2022-01-28 08:02:24', '黑龙江|昨日新增9例本土确诊病例', '2022年1月27日0—24时，黑龙江省新增本土确诊病例9例（绥芬河市9例），新增本土无症状感染者9例（绥芬河市6例、东宁市3例）。\n新增阳性感染者均为集中隔离管控期间筛查发现。\n截至1月27日24时，黑龙江省现有本土确诊病例18例，现有本土无症状感染者28例。\n自1月27日起，绥芬河市龙泉文苑8号楼、旗苑嘉园C区、馨怡纯粮油公司所在区域，东宁市邮政小区、春城小区调整为中风险地区。（总台央视记者', '央视新闻app');
INSERT INTO `news` VALUES ('83', '2022-01-28 07:53:15', '北京|昨日新增8例本土确诊病例', '1月27日0时至24时，北京新增8例本土确诊病例（含2例1月21日诊断的无症状感染者转确诊病例，确诊病例1至4昨日均已通报）和1例无症状感染者（昨日已通报），无新增疑似病例；新增2例境外输入确诊病例和15例无症状感染者，无新增疑似病例。治愈出院3例。', '央视新闻app');
INSERT INTO `news` VALUES ('84', '2022-01-28 07:47:15', '上海|昨日新增7例境外确诊病例', '2022年1月27日0—24时，通过口岸联防联控机制，上海报告7例新增境外输入性新冠肺炎确诊病例。新增治愈出院28例，其中来自美国14例，来自英国3例，来自巴西2例，来自加拿大2例，来自澳大利亚1例，来自芬兰1例，来自尼日利亚1例，来自德国1例，来自阿联酋1例，来自科特迪瓦1例，来自俄罗斯1例。\n病例1、病例2均为中国籍，病例1在英国工作，病例2在英国生活，病例1、病例2自英国出发，经德国转机，乘', '央视新闻app');
INSERT INTO `news` VALUES ('85', '2022-01-28 06:45:04', '云南|昨日新增5例境外输入确诊病例', '1月27日0-24时，云南省新增确诊病例5例，均为境外输入（缅甸5例）。\n现有境外输入确诊病例58例。累计确诊病例1405例，累计治愈出院病例1347例，无死亡病例。\n截至1月27日24时，云南省现有确诊病例68例，累计治愈出院病例1807例，累计死亡病例2例，累计报告确诊病例1877例。累计追踪到密切接触者37757人，尚在医学观察的密切接触者1099人。\n云南省新增无症状感染者8例，均为境外输', '央视新闻app');
INSERT INTO `news` VALUES ('86', '2022-02-05 09:03:19', '全国|昨日新增确诊病例27例，其中本土确诊病例9例', '据国家卫健委通报，2月4日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例27例。其中境外输入病例18例（上海7例，广东4例，浙江2例，河南2例，云南2例，天津1例），含6例由无症状感染者转为确诊病例（浙江2例，河南2例，广东2例）；本土病例9例（广东6例，其中深圳市2例、惠州市2例、云浮市2例；天津2例，均在河北区；北京1例，在丰台区），含1例由无症状感染者转为确诊病例（', '央视新闻app');
INSERT INTO `news` VALUES ('87', '2022-02-05 08:56:45', '广东|昨日新增6例本土确诊病例', '2月4日0-24时，广东省新增本土确诊病例6例，深圳报告2例，惠州报告2例，云浮报告2例（其中1例为无症状感染者转确诊）。以上均在纳入管控的密接排查中发现。\n广东全省新增境外输入确诊病例4例（其中2例为无症状感染者转确诊），均为广州报告，2例来自日本，其余2例分别来自新加坡和伊朗。新增境外输入无症状感染者11例，广州报告7例，3例来自土耳其，其余4例分别来自日本、蒙古、马来西亚和哈萨克斯坦；深圳报', '央视新闻app');
INSERT INTO `news` VALUES ('88', '2022-02-05 08:20:25', '天津|昨日新增2例本土确诊病例', '2022年2月4日0—24时，天津市新增2例本土新冠肺炎确诊病例。新增1例境外输入新冠肺炎确诊病例。无新增本土无症状感染者，无新增境外输入无症状感染者。治愈出院11人（其中本土病例6人，境外输入病例5人）。\n自2022年1月8日至2月4日，天津市累计报告本土新冠肺炎确诊病例420例，治愈出院360人，在院60例。累计报告本土无症状感染者22例，解除医学观察6人，转为确诊病例16例。', '央视新闻app');
INSERT INTO `news` VALUES ('89', '2022-02-05 07:51:43', '北京|昨日新增1例本土确诊病例', '2月4日0时至24时，北京新增1例本土确诊病例，无新增疑似病例和无症状感染者；无新增境外输入确诊病例、疑似病例，新增16例境外输入无症状感染者。治愈出院3例。\n确诊病例：现住丰台区西南郊冷库宿舍，工作地点为西南郊冷库。1月25日转至集中隔离点，2月4日核酸检测结果为阳性，转至定点医院，综合流行病史、临床表现、实验室检测和影像学检查等结果，当日诊断为确诊病例，临床分型为普通型。\n已对确诊病例开展流行', '央视新闻app');
INSERT INTO `news` VALUES ('90', '2022-02-05 08:49:00', '河南|昨日新增2例境外确诊病例', '记者从河南省卫健委了解到：2月4日0—24时，河南全省新增境外输入无症状感染者转确诊病例2例，无新增无症状感染者、疑似病例。59例本土确诊病例治愈出院。\n（总台记者田萌王一丹）', '央视新闻app');
