INSERT INTO `news` VALUES ('190', '2022-05-13 08:29:00', '河南|昨日新增本土确诊病例15例', '记者从河南省卫健委了解到，5月12日0—24时，河南全省新增本土确诊病例15例（许昌市9例，郑州市4例，平顶山市2例），含1例由无症状感染者转为确诊病例（许昌市1例）；新增本土无症状感染者29例（许昌市15例，郑州市10例，濮阳市3例，平顶山1例），无新增本土疑似病例。新增境外输入无症状感染者4例，无新增境外输入性确诊病例和疑似病例。\n2020年1月21日至2022年5月12日24时，全省累计报告', '央视新闻app');
INSERT INTO `news` VALUES ('202', '2022-05-14 07:45:10', '上海|昨日新增本土确诊病例194例', '上海市卫健委今早（14日）通报：2022年5月13日0—24时，新增本土新冠肺炎确诊病例194例和无症状感染者1487例，其中140例确诊病例为既往无症状感染者转归，54例确诊病例和1486例无症状感染者在隔离管控中发现。新增境外输入性新冠肺炎确诊病例1例，在闭环管控中发现。\n2022年5月13日0—24时，新增本土新冠肺炎确诊病例194例，含140例由既往无症状感染者转为确诊病例。新增治愈出院7', '央视新闻app');
INSERT INTO `news` VALUES ('203', '2022-05-14 08:08:16', '北京|昨日新增本土确诊病例32例', '\n5月13日0时至24时，新增32例本土确诊病例（含1例5月12日诊断的无症状感染者转确诊病例）和24例无症状感染者，无新增疑似病例；无新增境外输入确诊病例和疑似病例，新增1例境外输入无症状感染者。治愈出院39例。确诊病例1、2、26至29：现住房山区阳城环路1号。5月13日诊断为确诊病例。确诊病例3：现住房山区碧波园小区。5月13日诊断为确诊病例。确诊病例4：现住房山区窦店产业园。5月13日诊断为确诊病例。确诊病例5至12、21、22、23：现住海淀区福华鸿源酒店。5月13日诊断为确诊病例。确诊病例13：现住海淀区安河公寓。5月13日诊断为确诊病例。确诊病例14：现住丰台区芳星园。5月13日诊断为确诊病例。 确诊病例15：现住朝阳区南新园。5月13日诊断为确诊病例。确诊病例16：现住朝阳区双龙南里。5月13日诊断为确诊病例。确诊病例17：现住朝阳区垂杨柳北里。5月13日诊断为确诊病例。确诊病例18：现住西城区新街口外大街6号院。5月13日诊断为确诊病例。确诊病例19：现住西城区小酱坊胡同。5月13日诊断为确诊病例。确诊病例20：现住西城区春风胡同。5月13日诊断为确诊病例。确诊病例24：现住海淀区远洋风景。5月13日诊断为确诊病例。确诊病例25：现住海淀区白堆子甲23号院。5月13日诊断为确诊病例。确诊病例30：现住朝阳区驼房营南里。5月13日诊断为确诊病例。确诊病例31：现住丰台区海户屯。5月13日诊断为确诊病例。无症状感染者1：现住朝阳区农光东里。5月13日诊断为无症状感染者。无症状感染者2、17：现住海淀区福华鸿源酒店。5月13日诊断为无症状感染者。无症状感染者3：现住海淀区永定路30号院。5月13日诊断为无症状感染者。无症状感染者4：现住房山区大紫草坞村。5月13日诊断为无症状感染者。无症状感染者5：现住房山区大董村。5月13日诊断为无症状感染者。无症状感染者6：现住房山区石楼村。5月13日诊断为无症状感染者。无症状感染者7：现住丰台区大灰厂村。5月13日诊断为无症状感染者。无症状感染者8至12：现住朝阳区周庄嘉园东里。5月13日诊断为无症状感染者。无症状感染者13、14：现住海淀区安河公寓。5月13日诊断为无症状感染者。无症状感染者15：现住海淀区时代之光。5月13日诊断为无症状感染者。无症状感染者16：现住海淀区远洋风景。5月13日诊断为无症状感染者。无症状感染者18：现住海淀区东平庄。5月13日诊断为无症状感染者。无症状感染者19至24：现住房山区阳城环路1号。5月13日诊断为无症状感染者。上述病例均已转至定点医院，已开展流行病学调查，按要求落实管控措施。全市16区和经济技术开发区无报告病例天数情况地区\n无报告病例天数\n平谷区\n无报告病例\n怀柔区\n498\n延庆区\n18\n经开区\n12\n密云区\n9\n石景山区\n8\n门头沟区\n6\n昌平区\n4\n东城区\n2\n大兴区\n1\n通州区\n1\n顺义区\n1\n西城区\n0\n朝阳区\n0\n海淀区\n0\n丰台区\n0\n房山区\n0\n2020年2月29日发生境外输入疫情以来境外输入确诊病例来源国（地区）情况来源国（地区）\n确诊病例数\n英国\n79\n西班牙\n47\n奥地利\n31\n意大利\n28\n韩国\n27\n美国\n21\n瑞典\n21\n丹麦\n21\n塞尔维亚\n19\n俄罗斯\n19\n希腊\n19\n巴基斯坦\n14\n德国\n12\n阿联酋\n11\n加拿大\n9\n法国\n9\n泰国\n8\n瑞士\n8\n土库曼斯坦\n7\n菲律宾\n5\n土耳其\n5\n匈牙利\n5\n伊朗\n4\n津巴布韦\n3\n印度尼西亚\n2\n巴布亚新几内亚\n2\n摩尔多瓦\n2\n波兰\n2\n埃塞俄比亚\n2\n日本\n2\n卢森堡\n1\n挪威\n1\n比利时\n1\n巴西\n1\n荷兰\n1\n墨西哥\n1\n约旦\n1\n赤道几内亚\n1\n乌兹别克斯坦\n1\n新加坡\n1\n中国香港\n254\n中国台湾\n7\n合计\n715\n要坚持“动态清零”总方针不动摇，坚定必胜信心，压实“四方责任”，各区、各单位、各部门要利用周末窗口期，做好区域核酸筛查。请市民朋友积极配合，就近就便参加核酸检测，倡导周末居家休息，减少流动，不串门、不聚会、减少与外人接触，避免去人员密集的公共场所，做好个人防护。符合条件的老人和儿童，尽快接种新冠疫苗，完成基础免疫半年后请尽早进行加强免疫接种。\n\n', '北京卫健委');
INSERT INTO `news` VALUES ('234', '2022-06-27 09:04:43', '国家卫健委|昨日新增本土5+18例', '6月26日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例39例。其中境外输入病例34例（上海6例，陕西6例，天津5例，福建4例，广东4例，重庆3例，浙江2例，江苏1例，湖北1例，四川1例，云南1例），含7例由无症状感染者转为确诊病例（天津4例，浙江2例，福建1例）；本土病例5例（北京3例，上海2例）。无新增死亡病例。无新增疑似病例。\n当日新增治愈出院病例77例，其中境外输', '央视新闻app');
INSERT INTO `news` VALUES ('235', '2022-06-27 07:50:32', '北京|昨日新增本土确诊病例3例', '6月26日0时至24时，北京新增3例本土确诊病例和1例本土无症状感染者，无新增疑似病例；无新增境外输入确诊病例、疑似病例，新增1例境外输入无症状感染者。治愈出院22例，解除医学观察的无症状感染者16例。\n确诊病例1：现住经开区金茂府小区，6月26日诊断为确诊病例。\n确诊病例2、3：现住通州区台湖镇银河湾10号院，6月26日诊断为确诊病例。\n无症状感染者：现住经开区荣京丽都A座，6月26日诊断为无症', '央视新闻app');
INSERT INTO `news` VALUES ('236', '2022-06-27 07:41:53', '上海|昨日新增本土确诊病例2例', '上海市卫健委今早（6月27日）通报：2022年6月26日0—24时，新增本土新冠肺炎确诊病例2例和无症状感染者2例，其中2例确诊病例在隔离管控中发现。新增境外输入新冠肺炎确诊病例6例和无症状感染者5例，均在闭环管控中发现。\n2022年6月26日0—24时，新增本土新冠肺炎确诊病例2例。治愈出院4例。\n病例1、病例2，居住于静安区，均为上海市闭环隔离管控人员，其间新冠病毒核酸检测结果异常，经疾控中心', '央视新闻app');
INSERT INTO `news` VALUES ('237', '2022-06-26 22:14:05', '内蒙古|三地调整为低风险地区', '截至6月26日，内蒙古赤峰市林西县社会面已连续14日无新增确诊病例或无症状感染者。根据相关要求，经县专家组研判，林西县城北街道佳顺社区、城北街道金海社区、城南街道学府社区3个中风险地区降为低风险地区，林西县符合解除封控管控条件。林西县新冠肺炎疫情防控工作指挥部研究决定，自2022年6月27日0时起，恢复正常生产生活秩序，转入常态化疫情防控阶段。（总台记者杨顺顺）', '央视新闻app');
INSERT INTO `news` VALUES ('238', '2022-06-26 18:02:28', '北京|一地调整为低风险地区', '今天（6月26日）下午，北京市召开新冠肺炎疫情防控工作第377场新闻发布会，介绍疫情防控最新情况。\n&nbsp;\n今日0—15时北京新增2例本土新冠肺炎病毒感染者\n6月26日0时至15时，北京新增本土新冠肺炎病毒感染者2例（感染者2364、2365），通州区1例，经开区1例；普通型1例，轻型1例；均为隔离观察人员。已转至定点医院隔离治疗，相关风险点位及人员已管控落位。详情&gt;&gt;\n截至6', '央视新闻app');
