INSERT INTO `news` VALUES ('241', '2022-07-09 07:43:39', '上海|昨日新增本土确诊病例11例', '上海市卫健委今早（7月9日）通报：2022年7月8日0—24时，新增本土新冠肺炎确诊病例11例和无症状感染者48例，其中10例确诊病例和48例无症状感染者在隔离管控中发现。新增境外输入新冠肺炎确诊病例8例和无症状感染者14例，均在闭环管控中发现。\n（总台记者王殿甲杨静）', '央视新闻app');
