INSERT INTO `news` VALUES ('263', '2022-07-23 09:06:16', '四川|昨日新增本土确诊病例11例', '7月22日0时至24时，四川新增本土确诊病例11例（在成都），新增本土无症状感染者10例（成都3例，眉山6例，遂宁1例），新增境外输入确诊病例4例（在成都），新增境外输入无症状感染者7例（在成都），新增治愈出院病例3例，无新增疑似病例，无新增死亡病例。\n截至7月22日24时，全省共有36个高风险区，40个中风险区，12个低风险区。\n（总台记者郑轶）', '央视新闻app');
INSERT INTO `news` VALUES ('264', '2022-07-26 09:12:08', '国家卫健委|昨日新增本土98+770例', '7月25日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例148例。其中境外输入病例50例（广东19例，福建11例，四川6例，浙江3例，北京2例，上海2例，山东2例，天津1例，辽宁1例，湖北1例，重庆1例，陕西1例），含14例由无症状感染者转为确诊病例（浙江3例，广东3例，四川3例，福建2例，山东2例，天津1例）；本土病例98例（甘肃37例，广西32例，四川16例，广东6例', '央视新闻app');
INSERT INTO `news` VALUES ('265', '2022-07-26 08:33:27', '广西|昨日新增本土确诊病例32例', '7月25日0-24时，广西新增本土确诊病例32例（均在北海市，其中海城区25例，银海区6例，合浦县1例），含9例无症状感染者订正为确诊病例（均在北海市）；本土无症状感染者370例（北海市365例，其中海城区334例，银海区27例，合浦县3例，铁山港区1例；防城港市4例，其中防城区3例，东兴市1例；南宁市青秀区1例）。当日治愈出院本土确诊病例12例（均在北海市），解除隔离医学观察本土无症状感染者45', '央视新闻app');
INSERT INTO `news` VALUES ('266', '2022-07-26 09:11:36', '四川|昨日新增本土确诊病例16例', '7月25日0—24时，四川新增本土确诊病例16例（在成都，其中5例为既往通报的无症状感染者转确诊），新增本土无症状感染者14例（成都12例，眉山2例），新增境外输入确诊病例6例（在成都，其中3例为既往通报的无症状感染者转确诊），新增境外输入无症状感染者10例（在成都），新增治愈出院病例1例，无新增疑似病例，无新增死亡病例。\n（总台记者郑轶）', '央视新闻app');
INSERT INTO `news` VALUES ('267', '2022-07-26 07:43:21', '上海|昨日新增本土确诊病例4例', '上海市卫健委今早（7月26日）通报：2022年7月25日0—24时，新增本土新冠肺炎确诊病例4例和无症状感染者15例，其中4例确诊病例和12例无症状感染者在隔离管控中发现。新增境外输入性新冠肺炎确诊病例2例和无症状感染者7例，均在闭环管控中发现。\n2022年7月25日0—24时，新增本土新冠肺炎确诊病例4例。治愈出院7例。\n病例1，居住于静安区，病例2、病例3，居住于宝山区，病例4，居住于松江区，', '央视新闻app');
INSERT INTO `news` VALUES ('268', '2022-07-26 07:14:20', '山东|昨日新增本土确诊病例1例', '2022年7月25日0时至24时，山东省报告新增本土确诊病例1例，新增本土无症状感染者27例，均在菏泽。无新增境外输入确诊病例。新增境外输入无症状感染者7例，其中青岛4例，分别为德国输入、日本输入、韩国输入和新加坡输入；济南3例，均为日本输入。\n2022年7月25日0时至24时，山东省报告境外输入无症状感染者转为确诊病例2例，其中济南1例、青岛1例。\n2022年7月25日0时至24时，山东省本土确', '央视新闻app');
INSERT INTO `news` VALUES ('269', '2022-07-28 09:06:35', '国家卫健委|昨日新增本土86+435例', '7月27日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例119例。其中境外输入病例33例（广东10例，上海9例，福建5例，四川2例，陕西2例，辽宁1例，浙江1例，山东1例，河南1例，云南1例），含2例由无症状感染者转为确诊病例（广东1例，四川1例）；本土病例86例（广西32例，甘肃23例，四川17例，河南7例，广东4例，上海3例），含41例由无症状感染者转为确诊病例（甘肃', '央视新闻app');
INSERT INTO `news` VALUES ('270', '2022-07-28 08:57:42', '四川|昨日新增本土确诊病例17例', '7月27日0—24时，四川新增本土确诊病例17例（成都16例，其中6例为既往通报的无症状感染者转确诊；眉山1例，为既往通报的无症状感染者转确诊），新增本土无症状感染者13例（成都12例，内江1例），新增境外输入确诊病例2例（在成都，其中1例为既往通报的无症状感染者转确诊），新增境外输入无症状感染者7例（在成都），新增治愈出院病例1例，无新增疑似病例，无新增死亡病例。\n（总台记者郑轶）', '央视新闻app');
INSERT INTO `news` VALUES ('271', '2022-07-28 08:30:00', '河南|昨日新增本土确诊病例7例', '记者从河南省卫健委了解到，7月27日0—24时，河南全省新增本土确诊病例7例（信阳市3例，商丘市2例，开封市1例；无症状感染者转确诊病例1例，驻马店市1例），新增本土无症状感染者5例（开封市5例），无新增本土疑似病例。新增境外输入确诊病例1例，新增境外输入无症状感染者1例，无新增境外输入疑似病例。113例本土无症状感染者解除医学观察（驻马店市111例，平顶山市2例）。\n（总台记者田萌）', '央视新闻app');
INSERT INTO `news` VALUES ('272', '2022-07-28 07:48:58', '上海|昨日新增本土确诊病例3例', '上海市卫健委今早（7月28日）通报：2022年7月27日0—24时，新增本土新冠肺炎确诊病例3例和无症状感染者11例，均在隔离管控中发现。新增境外输入新冠肺炎确诊病例9例和无症状感染者27例，均在闭环管控中发现。\n2022年7月27日0—24时，上海新增本土新冠肺炎确诊病例3例。治愈出院3例。\n病例1，居住于杨浦区，病例2、病例3，居住于宝山区，均为上海市闭环隔离管控人员，其间新冠病毒核酸检测结果', '央视新闻app');
INSERT INTO `news` VALUES ('273', '2022-07-28 08:57:38', '天津|三地调整风险地区等级', '记者从天津河西区获悉，为快速有效阻断疫情扩散风险，依据相关法律法规和疫情防控有关规定，经专家组综合研判，河西区疫情防控指挥部调整风险区域：\n一、划定河西区东海街桂江里2、4、6、8、10、12、59、88、90门为高风险区。高风险区内，实行“足不出户、上门服务”等管控措施，居民定期进行核酸检测。\n二、划定河西区东海街桂江里14、16、18、20、22、24、39、41、43、45、47、49、51', '央视新闻app');
