INSERT INTO `news` VALUES ('276', '2022-07-28 08:30:00', '河南|昨日新增本土确诊病例7例', '记者从河南省卫健委了解到，7月27日0—24时，河南全省新增本土确诊病例7例（信阳市3例，商丘市2例，开封市1例；无症状感染者转确诊病例1例，驻马店市1例），新增本土无症状感染者5例（开封市5例），无新增本土疑似病例。新增境外输入确诊病例1例，新增境外输入无症状感染者1例，无新增境外输入疑似病例。113例本土无症状感染者解除医学观察（驻马店市111例，平顶山市2例）。\n（总台记者田萌）', '央视新闻app');
INSERT INTO `news` VALUES ('277', '2022-07-28 07:48:58', '上海|昨日新增本土确诊病例3例', '上海市卫健委今早（7月28日）通报：2022年7月27日0—24时，新增本土新冠肺炎确诊病例3例和无症状感染者11例，均在隔离管控中发现。新增境外输入新冠肺炎确诊病例9例和无症状感染者27例，均在闭环管控中发现。\n2022年7月27日0—24时，上海新增本土新冠肺炎确诊病例3例。治愈出院3例。\n病例1，居住于杨浦区，病例2、病例3，居住于宝山区，均为上海市闭环隔离管控人员，其间新冠病毒核酸检测结果', '央视新闻app');
INSERT INTO `news` VALUES ('278', '2022-07-28 08:57:38', '天津|三地调整风险地区等级', '记者从天津河西区获悉，为快速有效阻断疫情扩散风险，依据相关法律法规和疫情防控有关规定，经专家组综合研判，河西区疫情防控指挥部调整风险区域：\n一、划定河西区东海街桂江里2、4、6、8、10、12、59、88、90门为高风险区。高风险区内，实行“足不出户、上门服务”等管控措施，居民定期进行核酸检测。\n二、划定河西区东海街桂江里14、16、18、20、22、24、39、41、43、45、47、49、51', '央视新闻app');
INSERT INTO `news` VALUES ('279', '2022-07-30 09:01:24', '国家卫健委|昨日新增本土49+271例', '7月29日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例100例。其中境外输入病例51例（福建13例，上海12例，广东6例，北京5例，四川4例，陕西4例，辽宁2例，山东2例，山西1例，湖北1例，云南1例），含2例由无症状感染者转为确诊病例（均在福建）；本土病例49例（甘肃19例，广西15例，四川10例，山东2例，上海1例，河南1例，广东1例），含21例由无症状感染者转为确', '央视新闻app');
INSERT INTO `news` VALUES ('280', '2022-07-29 09:12:17', '甘肃|昨日新增本土确诊病例21例', '据甘肃省卫健委消息，现将7月28日0—24时甘肃省新冠肺炎疫情信息公布如下：\n本地疫情：\n7月28日0—24时，甘肃省新增确诊病例21例，其中兰州市13例（城关区12例，榆中县1例）、甘南州5例（夏河县3例，玛曲县2例）、临夏州2例（广河县1例，东乡县1例）、白银市白银区1例。含无症状感染者转确诊病例14例，其中兰州市9例（城关区8例，榆中县1例）、甘南州5例（夏河县3例，玛曲县2例）。新增无症状', '央视新闻app');
INSERT INTO `news` VALUES ('281', '2022-07-29 09:14:37', '四川|昨日新增本土确诊病例16例', '\n    7月28日0—24时，四川新增本土确诊病例16例（成都15例，其中5例为既往通报的无症状感染者转确诊；眉山1例，为既往通报的无症状感染者转确诊），新增本土无症状感染者29例（成都27例，德阳1例，内江1例），新增境外输入确诊病例4例（在成都，其中2例为既往通报的无症状感染者转确诊），新增境外输入无症状感染者8例（在成都），新增治愈出院病例3例，无新增疑似病例，无新增死亡病例。    具体情况如下：    新增本土确诊病例16例（成都15例，眉山1例）：    6例（成都5例，眉山1例）为既往通报的无症状感染者转确诊；    6例在我省“7·20”关联疫情成都市隔离管控人员中发现；    4例在我省“7·20”关联疫情成都市风险区域筛查中发现；    均于7月28日确诊。    新增本土无症状感染者29例（成都27例，德阳1例，内江1例）：    14例在我省“7·20”关联疫情成都市隔离管控人员中发现；    13例在我省“7·20”关联疫情成都市风险区域筛查中发现；    1例在我省“7·20”关联疫情德阳市风险人员筛查中发现；    1例在我省“7·20”关联疫情内江市隔离管控人员中发现；    均于7月28日诊断为无症状感染者。    新增境外输入确诊病例4例（在成都）：    2例为既往通报的无症状感染者转确诊；    1例为7月25日自中国香港乘机抵蓉进行隔离；    1例为7月27日自德国乘机抵蓉进行隔离；    均于7月28日确诊。    新增境外输入无症状感染者8例（在成都）：    1例为7月23日自中国香港乘机抵蓉进行隔离；    1例为7月25日自中国香港乘机抵蓉进行隔离；    2例为7月26日自中国台湾乘机抵蓉进行隔离；    2例为7月27日自德国乘机抵蓉进行隔离；    2例为7月27日自中国香港乘机抵蓉进行隔离；    均于7月28日诊断为无症状感染者。   （确诊病例及无症状感染者具体情况由相关市（州）卫生健康委进行通报）    温馨提示：保持警惕，做好防护，勤洗手、不扎堆、少聚集，若有发热、咳嗽等不适症状，请及时就近前往发热门诊、哨点诊室、新冠病毒核酸检测机构。具体请点击https://hissct.mobimedical.cn/urgentYiq，随时查看距您最近的医疗卫生机构，快捷咨询，精准预约。\n    点击健康四川官微左下角“疫情防控”栏目可查询“疫情。', '四川卫健委');
INSERT INTO `news` VALUES ('282', '2022-07-29 08:47:21', '广西|昨日新增本土确诊病例10例', '7月28日0—24时，广西新增本土确诊病例10例（均在北海市，其中海城区9例，银海区1例），含2例无症状感染者转确诊病例（均在北海市）；本土无症状感染者121例（北海市106例，其中海城区99例，银海区7例；崇左市宁明县13例；南宁市兴宁区1例；防城港东兴市1例）。当日治愈出院本土确诊病例29例（均在北海市），解除隔离医学观察本土无症状感染者41例（北海市39例，南宁市1例，桂林市1例）。截至7月', '央视新闻app');
INSERT INTO `news` VALUES ('283', '2022-07-29 08:30:00', '河南|昨日新增本土确诊病例4例', '记者从河南省卫健委了解到，7月28日0—24时，全省新增本土确诊病例4例（信阳市罗山县2例，开封市兰考县1例，驻马店市泌阳县1例、系无症状感染者转确诊病例），新增本土无症状感染者17例（商丘市民权县7例，信阳市罗山县6例，开封市兰考县3例，郑州市二七区1例），无新增本土疑似病例。新增境外输入确诊病例2例，新增境外输入无症状感染者8例，无新增境外输入疑似病例。1例本土确诊病例治愈出院（驻马店市泌阳县', '央视新闻app');
