INSERT INTO `news` VALUES ('296', '2022-08-01 09:06:10', '四川|昨日新增本土确诊病例3例 ', '7月31日0—24时，四川新增本土确诊病例3例（在成都），新增本土无症状感染者4例（在成都），新增境外输入确诊病例6例（在成都，其中1例为既往通报的无症状感染者转确诊），新增境外输入无症状感染者3例（在成都），新增治愈出院病例6例，无新增疑似病例，无新增死亡病例。\n（总台记者郑轶）', '央视新闻app');
INSERT INTO `news` VALUES ('297', '2022-08-01 07:03:01', '山东|昨日新增本土确诊病例2例', '2022年7月31日0时至24时，山东省报告新增本土确诊病例2例，均在菏泽，均系集中隔离点检出。新增本土无症状感染者49例，均在菏泽，其中47例系集中隔离点检出，2例系高风险区检出。新增境外输入确诊病例1例，在青岛，为德国输入。新增境外输入无症状感染者2例，其中济南1例，为俄罗斯输入；青岛1例，为德国输入。\n2022年7月31日0时至24时，山东省报告境外输入无症状感染者转为确诊病例2例，均在济南', '央视新闻app');
INSERT INTO `news` VALUES ('298', '2022-08-01 09:03:52', '内蒙古|昨日新增本土确诊病例1例', '据内蒙古自治区卫健委官网消息，7月31日0—24时，内蒙古自治区报告新增本土确诊病例1例（在锡林郭勒盟二连浩特市），本土无症状感染者3例（均在锡林郭勒盟二连浩特市）。境外输入无症状感染者2例（均由首都机场国际航班分流至呼和浩特白塔国际机场）。\n截至7月31日24时，内蒙古自治区现有本土确诊病例1例（在锡林郭勒盟二连浩特市）。本土无症状感染者3例（均在锡林郭勒盟二连浩特市）。境外输入无症状感染者6例', '央视新闻app');
