INSERT INTO `news` VALUES ('336', '2022-08-18 09:15:30', '浙江|昨日新增本土确诊病例14例', '8月17日0-24时，浙江11个市报告新增本土阳性21例，均为集中隔离点检出，均已落实管控措施。\n11个市报告新增确诊病例16例。其中境外输入病例2例（韩国输入1例，由此前境外输入的无症状感染者转为确诊1例）；本土病例14例（杭州市1例，宁波市1例，温州市9例，金华市3例），其中6例为此前的无症状感染者转为确诊（杭州市1例，温州市2例，金华市3例），当日新检出确诊为8例。\n当日新增治愈出院病例8例', '央视新闻app');
INSERT INTO `news` VALUES ('337', '2022-08-18 09:11:06', '福建|昨日新增本土确诊病例10例', '8月17日0—24时，福建省报告新增本土确诊病例10例（厦门市10例）。当日无报告新增本土无症状感染者，解除隔离1例。\n福建全省本土确诊病例目前住院61例，无死亡病例；现有本土无症状感染者尚在接受集中隔离医学观察7例。\n（总台记者黄珊）', '央视新闻app');
