INSERT INTO `news` VALUES ('340', '2022-08-19 09:20:18', '海南|昨日新增本土确诊病例441例', '据海南省卫健委消息，8月18日0-24时，海南省新增本土确诊病例441例（含无症状感染者转确诊病例40例），其中三亚市329例（含无症状感染者转确诊病例3例）、儋州市34例（含无症状感染者转确诊病例32例）、东方市33例（含无症状感染者转确诊病例4例）、万宁市21例（含无症状感染者转确诊病例1例）、乐东县13例、临高县7例、陵水县3例、海口1例；新增本土无症状感染者1058例，其中三亚市667例、', '央视新闻app');
