INSERT INTO `news` VALUES ('343', '2022-08-19 09:08:04', '内蒙古|昨日新增本土确诊病例4例', '8月18日0—24时，内蒙古自治区报告新增本土确诊病例4例，其中呼和浩特市2例（均在隔离点检出，其中1例由无症状感染者转为确诊病例，系外省推送确诊病例的密切接触者，1例系8月13日同一航班确诊病例的密切接触者）、呼伦贝尔市2例（均在隔离点检出，在满洲里市），本土无症状感染者1例（在社区筛查中检出，在呼伦贝尔满洲里市）。境外输入无症状感染者2例（均由首都机场国际航班分流至呼和浩特白塔国际机场）。本土', '央视新闻app');
