INSERT INTO `news` VALUES ('345', '2022-08-25 08:49:08', '海南|昨日新增本土确诊病例217例', '2022年8月24日0-24时，海南省新增感染者401例（确诊217例，减去无症状转确诊125例；无症状309例）。其中，新增本土确诊217例（含无症状转确诊125例），其中三亚市170例（含无症状转确诊103例）、儋州市26例（含无症状转确诊15例）、万宁市10例（含无症状转确诊4例）、乐东县5例（含无症状转确诊1例）、东方市3例、海口市1例（为无症状转确诊）、临高县1例（为无症状转确诊）、陵水', '央视新闻app');
INSERT INTO `news` VALUES ('346', '2022-08-25 08:03:20', '重庆|昨日新增本土确诊病例27例', '8月24日0—24时，重庆市新增本土确诊病例27例，其中，九龙坡区4例、开州区1例，均在隔离管控人员中发现；长寿区2例，1例在隔离管控人员中发现、1例在管控人员中发现；沙坪坝区20例，13例在隔离管控人员中发现、7例在管控人员中发现。新增本土无症状感染者16例，其中，九龙坡区2例、北碚区1例、大渡口区2例，均在隔离管控人员中发现；长寿区2例，1例在隔离管控人员中发现、1例在管控人员中发现；巴南区1', '央视新闻app');
