INSERT INTO `news` VALUES ('353', '2022-08-29 10:17:26', '广东|昨日新增本土确诊病例10例', '8月28日0-24时，广东全省新增本土确诊病例9例（深圳9例）；新增本土无症状感染者3例（广州1例，深圳2例）。另有1例本土无症状感染者转确诊病例（广州1例）。全省新增境外输入确诊病例10例（广州5例，深圳3例，珠海2例）；新增境外输入无症状感染者16例（广州7例，深圳4例，佛山1例，惠州1例，东莞3例）；另有2例境外输入无症状感染者转确诊病例（广州2例）。\n全省新增出院32例（境外输入17例），', '央视新闻app');
