INSERT INTO `news` VALUES ('392', '2022-09-06 08:21:30', '黑龙江|昨日新增本土确诊病例7例', '记者从黑龙江省卫健委获悉，9月5日0—24时，黑龙江省新增本土新冠肺炎确诊病例7例（大庆市6例，其中萨尔图区3例、龙凤区3例；哈尔滨市1例，在道里区）；新增本土无症状感染者148例（大庆市146例，其中萨尔图区108例、龙凤区28例、让胡路区10例；哈尔滨市1例，在道外区；绥化市1例，在肇东市）。新增境外输入确诊病例1例（哈尔滨市报告）。当日解除医学观察本土无症状感染者8例（大庆市5例，黑河市3例', '央视新闻app');
INSERT INTO `news` VALUES ('393', '2022-09-06 08:07:54', '辽宁|昨日新增本土确诊病例2例', '9月5日0—24时，辽宁省新增2例本土新冠肺炎确诊病例，均为大连市报告；新增89例本土无症状感染者，其中大连市报告85例、鞍山市报告1例、本溪市报告1例、营口市报告2例；新增1例境外输入新冠肺炎确诊病例，为沈阳市报告。解除医学观察本土无症状感染者4例、境外输入无症状感染者3例。\n截至9月5日24时，辽宁省累计报告确诊病例1855例（含境外输入274例），治愈出院1773例，死亡2例，在院治疗80例', '央视新闻app');
INSERT INTO `news` VALUES ('394', '2022-09-07 09:01:53', '国家卫健委|昨日新增本土323+1247例', '9月6日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例380例。其中境外输入病例57例（广东19例，上海12例，福建7例，北京4例，天津4例，四川4例，江苏2例，山东2例，内蒙古1例，黑龙江1例，湖南1例），含7例由无症状感染者转为确诊病例（广东3例，北京1例，江苏1例，湖南1例，四川1例）；本土病例323例（四川85例，西藏76例，内蒙古57例，广东42例，北京14例，', '央视新闻app');
INSERT INTO `news` VALUES ('395', '2022-09-07 08:53:52', '四川|昨日新增本土确诊病例85例', '9月6日0—24时，四川新增本土确诊病例85例：成都73例，泸州2例，攀枝花1例，阿坝1例；8例由既往无症状感染者转为确诊病例（阿坝5例，凉山1例，绵阳1例，宜宾1例）。\n新增本土无症状感染者72例：成都48例，泸州8例，达州7例，阿坝5例，南充3例，宜宾1例。\n新增境外输入确诊病例4例（在成都），新增境外输入无症状感染者7例（成都6例，巴中1例）。\n新增治愈出院病例56例，无新增疑似病例，无新增', '央视新闻app');
INSERT INTO `news` VALUES ('396', '2022-09-07 07:50:37', '北京|昨日新增本土确诊病例14例', '9月6日0时至24时，北京新增14例本土确诊病例，无新增疑似病例和无症状感染者；新增4例境外输入确诊病例（含1例无症状感染者转确诊病例）和3例无症状感染者，无新增疑似病例。治愈出院4例，解除医学观察的无症状感染者11例。\n本土确诊病例\n确诊病例1：现住中央民族大学附属中学，为社会面筛查人员，9月6日诊断为确诊病例。\n确诊病例2：现住北京化工大学昌平校区，通过120主动送诊、发热门诊筛查发现，9月6', '央视新闻app');
INSERT INTO `news` VALUES ('397', '2022-09-07 07:08:00', '山东|昨日新增本土确诊病例12例', '2022年9月6日0时至24时，山东省报告新增本土确诊病例12例，均在青岛，其中11例系密切接触者筛查检出，1例系重点人员筛查检出。新增本土无症状感染者80例，其中济宁54例，系集中隔离点检出52例和社区筛查检出2例；青岛26例，系密切接触者筛查检出25例和主动就诊检出1例。新增境外输入确诊病例2例，其中青岛1例，为德国输入；烟台1例，为俄罗斯输入。新增境外输入无症状感染者3例，均在烟台，均为俄罗', '央视新闻app');
INSERT INTO `news` VALUES ('398', '2022-09-07 08:02:37', '重庆|昨日新增本土确诊病例1例', '9月6日0—24时，重庆市新增本土确诊病例1例（巴南区），在隔离管控人员中发现；无新增本土无症状感染者。治愈出院本土确诊病例15例（沙坪坝区7例、九龙坡区3例、璧山区1例、巴南区2例、北碚区1例、渝中区1例），解除本土无症状感染者医学观察11例（沙坪坝区5例、九龙坡区2例、巴南区2例、长寿区1例、渝中区1例）。\n截至9月6日24时，重庆市现有本土确诊病例62例（沙坪坝区14例、九龙坡区7例、璧山区', '央视新闻app');
INSERT INTO `news` VALUES ('399', '2022-09-08 09:13:00', '国家卫健委|昨日新增本土241+1093例', '9月7日0—24时，31个省（自治区、直辖市）和新疆生产建设兵团报告新增确诊病例280例。其中境外输入病例39例（福建8例，上海7例，北京6例，广东6例，山东3例，云南3例，天津1例，内蒙古1例，浙江1例，重庆1例，四川1例，陕西1例），含1例由无症状感染者转为确诊病例（在广东）；本土病例241例（四川69例，内蒙古67例，广东27例，西藏18例，山东15例，广西8例，北京7例，黑龙江6例，贵州4', '央视新闻app');
