INSERT INTO `news` VALUES ('416', '2022-09-12 07:50:38', '北京|昨日新增本土确诊病例15例', '9月11日0时至24时，北京新增15例本土确诊病例（均为隔离观察人员，含1例无症状感染者转确诊病例），无新增疑似病例和无症状感染者；新增2例境外输入确诊病例（均为无症状感染者转确诊病例）和3例无症状感染者，无新增疑似病例。治愈出院3例，解除医学观察的无症状感染者2例。\n本土确诊病例\n确诊病例1、2：现住中央民族大学附属中学，为隔离观察人员，9月11日诊断为确诊病例。\n确诊病例3至9：现住北京化工大', '央视新闻app');
INSERT INTO `news` VALUES ('417', '2022-09-12 07:06:26', '山东|昨日新增本土确诊病例9例', '2022年9月11日0时至24时，山东省报告新增本土确诊病例9例，其中青岛8例、济宁1例，均系集中隔离点检出。新增本土无症状感染者28例，其中青岛14例，系集中隔离点检出10例、高风险区检出2例和闭环管理重点人员筛查检出2例；济宁13例，系集中隔离点检出11例和居家隔离医学观察检出2例；烟台1例，系社区筛查检出。无新增境外输入确诊病例。新增境外输入无症状感染者2例，其中烟台1例，为俄罗斯输入；威海', '央视新闻app');
INSERT INTO `news` VALUES ('418', '2022-09-12 08:26:55', '新疆|昨日新增本土确诊病例4例', '新疆维吾尔自治区卫生健康委通报，9月11日0至24时，新疆维吾尔自治区新增本土无症状感染者转确诊病例4例，其中，乌鲁木齐市天山区2例、水磨沟区2例；新增本土无症状感染者24例，其中，乌鲁木齐市天山区7例、水磨沟区1例，伊犁州伊宁市11例，巴州库尔勒市5例。\n9月11日0至24时，新疆维吾尔自治区新增本土确诊病例治愈出院1例；新增本土无症状感染者解除隔离医学观察45例。\n截至9月11日24时，新疆维', '央视新闻app');
