INSERT INTO `news` VALUES ('441', '2022-09-19 08:10:27', '天津|昨日本土新增确诊病例8例', '记者从天津市疫情防控指挥部获悉，2022年9月18日0时至24时，天津市疾控部门报告新增26例本土新冠病毒核酸检测阳性感染者，其中确诊病例8例（均为轻型），无症状感染者18例。26例感染者中，25例为管控人员，1例为非管控人员，详情如下：\n阳性感染者1，男，27岁，居住于天津市西青区大寺镇，系管控人员筛查发现，9月17日采集咽拭子，经检测中心检测，9月18日结果呈阳性，为新冠病毒无症状感染者。\n阳', '央视新闻app');
