INSERT INTO `news` VALUES ('498', '2022-10-03 08:05:44', '辽宁|昨日新增本土确诊病例1例', '10月2日0—24时，辽宁省新增1例本土新冠肺炎确诊病例，为朝阳市报告；新增1例境外输入无症状感染者，为大连市报告。治愈出院境外输入新冠肺炎确诊病例4例；解除医学观察境外输入无症状感染者1例。\n截至10月2日24时，辽宁省累计报告确诊病例1896例（含境外输入300例），治愈出院1880例，死亡2例，在院治疗14例（本土6例、境外输入8例）。目前，尚在医学观察的无症状感染者47例（本土20例、境外', '央视新闻app');
