INSERT INTO `news` VALUES ('503', '2022-10-04 08:02:22', '黑龙江|昨日新增本土确诊病例2例', '记者从黑龙江省卫健委获悉，10月3日0—24时，黑龙江省新增本土确诊病例2例，哈尔滨市1例（在香坊区，外省输入），为非闭环管理重点人群筛查发现；黑河市1例（在爱辉区），为无症状感染者转确诊病例。新增本土无症状感染者4例，黑河市3例（爱辉区2例、嫩江市1例），均为集中隔离发现；哈尔滨市1例（在香坊区，外省输入），为密切接触者筛查发现。新增境外输入无症状感染者1例（哈尔滨市报告）。当日治愈出院本土确诊', '央视新闻app');
